import Typography from '@mui/material/Typography';
import PetTable from './Components/PetTable/PetTable';

function App() {

  var petTable = makeAPetTable();

  return (
    <div className="App">
        <Typography variant="h2">Welcome to Pet-a-dex, the Pet organization solution.</Typography>
        <PetTable pets={petTable}/>
    </div>
  );

  function makeAPetTable(){

    let petArray = [
      {
        id: 1,
        name: "rex",
        age: 3,
        species: "labrapoodle",
      },
      {
        id: 2,
        name: "Porkchop",
        age: 12,
        species: "pig",
      }
    ]

    return(petArray);
  }
}

export default App;
